using System.Collections;using System.Collections.Generic;using UnityEngine;public class SortAndSweep{    internal struct GameObjectsPair    {        internal GameObject gameObject1;        internal GameObject gameObject2;        private GameObjectsPair(GameObject gameObject1, GameObject gameObject2)        {            this.gameObject1 = gameObject1;            this.gameObject2 = gameObject2;        }    }    private List<GameObject> gameObjects;    public SortAndSweep(List<GameObject> gameObjects)    {        this.gameObjects = gameObjects;    }    internal List<GameObjectsPair> CheckForPossibleCollisions()    {        List<GameObjectsPair> result = new List<GameObjectsPair>();        return result;    }}